const NFLPlayer = ({ nflPlayer }) => {
  return (
    <div>
       {
         Object.keys(nflPlayer).map((key, index) => {
           <li key={key}>
              {nflPlayer[key]}
              {console.log(nflPlayer[key])}
          </li>
         })
       }
    </div>
  )
}

export default NFLPlayer
